import React, { Component } from "react";
import Slider from "react-slick";
import {slickDot } from "../page-demo/script";
import BlogContent from "../elements/blog/BlogContent";


class BlogSlideHomepage extends Component{
    render(){

      const PostList = BlogContent.slice(0 , BlogContent.length);

        return(
          <React.Fragment>
            <div className="active-dark rn-featured-service-area  pb--120 bg_color--5" id="blog">
                <div className="container">
                    <div className="row">

                        {/* Start Single Service  */}
                        <div className="col-lg-3 col-md-6 col-12 mt--30">
                            <div className="text-left section-title">
                                <h2 className="title ">Latest News</h2>
                                <div className="service-btn">
                                    <a href="/Blog"><h4 className="text">View all <img src="assets/images/icons/DNA-Global-Analytics-slick-arrow-right-small.png" alt="DNA Global Analytics - Blog"/></h4></a>
                                </div>
                            </div>
                        </div>
                        {/* End Single Service  */}

                        {/* Start Single Service  */}
                        <div className="col-lg-9">
                            <Slider {...slickDot}>
                                {PostList.map((value , index) => (
                                    <div className="blog col-lg-12 col-md-4 mt--30" key={index}>
                                            <div className="thumbnail">
                                                <a href={value.link}><img src={`/assets/images/blog/DNA-Global-Analytics-blog-${value.images}.jpg`} alt={`DNA Global Analytics - ${value.title}`}/></a>
                                            </div>
                                            <div className="content">
                                              <a href={value.link}><br/><h3 style={{color:'white'}}>{value.title}</h3></a>
                                                <p style={{color:'white'}}>{value.description}</p>
                                                <a className="btn-transparent rn-btn-dark" href={value.link}><span className="text"style={{color:'#F9004D'}}>Read More</span></a>
                                            </div>
                                    </div>
                                ))}
                            </Slider>
                        </div>
                        {/* End Single   */}


                    </div>
                </div>
            </div>
          </React.Fragment>
        )
    }
}


export default BlogSlideHomepage;
